subSubSection.paragraph:
Male terminalia
. Apex of ventral median lobe rounded and apex of dorsal lobe narrowly rounded or slightly pointed; dorsal lobe shorter than ventral lobe. Spined region of internal sac divided into two sections: first section longer than unspined gap and second section combined, with fairly dense multi-branched spines on basal 2/3 and some scale-like spines on apical 1/3; second section with sparse short simple spines (
Fig. 87a
). Eighth sternite rounded or slightly obliquely truncate at side, almost truncate at apex, with fairly long setae arising terminally; ventral surface with cloud-like processes (
Fig. 87b
). Eighth tergite truncate and shallowly emarginate at apex; surface with fairly dense basally-forked spines and simple spines (
Fig. 87c
). Paramere robust, 2.0–2.09 × as long as wide, apex obliquely truncate with fairly dense long and short setae (
Fig. 87d
).

Ovipositor and spermatheca.
Ovipositor relatively long; styli long, arising terminally with short and long hairs (
Fig. 87e
). Spermatheca curved, particularly near apex; spermathecal gland relatively long, arising at base (
Fig. 87f
).
